import React, { Component} from 'react';
import logo from './logo.svg';
import './App.css';
import Post from './components/Post';
import Navbar from './components/FireNavbar';


class App extends Component {
  render () {
    return (
      <div className="App">
       <Navbar />
        <Post />
      </div>
    ); 
  }
}

export default App;
